import Main from "./pages/Main";
import {BOXPAGE_ROUTE, LOGIN_ROUTE, MAIN_ROUTE, ORDER_ROUTE, ORDERPAGE_ROUTE} from "./utils";
import BoxPage from "./pages/BoxPage";
import Order from "./pages/Order";
import Auth from "./pages/Auth";
import OrderPage from "./pages/OrderPage";

export const authRoutes = [
    {
        path:MAIN_ROUTE,
        Component: <Main/>
    },
    {
        path:BOXPAGE_ROUTE + '/:id',
        Component: <BoxPage/>
    },
    {
        path:ORDER_ROUTE,
        Component: <Order/>
    },
    {
        path:ORDERPAGE_ROUTE + '/:id',
        Component: <OrderPage/>
    },


]
export const publickRoutes = [
    {
        path:LOGIN_ROUTE,
        Component: <Auth/>
    }
]
